import React, {useContext,} from 'react';
import {Main, Card, Result} from './AppStyled.js';
import TitleComponent from '../components/Title/Title.jsx';
import SliderComponent from '../components/Slider/Slider.jsx';
import ButtonComponent from '../components/Button/Button.jsx';
import {HightContext} from "../contexts/HightProvider.jsx";
import {useForm} from "react-hook-form";


const App = () => {

  const [hight, setHight] = useContext(HightContext);

  let result = null;
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("calculou");
    result = hight / Math.pow(2, 2);
  }

  return (
    <Main>
      <Card onSubmit={handleSubmit}>
        <TitleComponent/> 
        <SliderComponent type = "peso"/>
        <SliderComponent type = "altura"/>       
        <ButtonComponent/>
        <Result>{result}</Result>
      </Card>
    </Main>
  ); 
}

export default App;
